import "bootstrap/dist/css/bootstrap.min.css";
import React from "react";
const ListTasks = (props) => {
  let disp = <p>Let's Start Sorting your Schedule</p>;

  if (props.liTasks.keys().length !== 0) {
    disp = (
      <React.Fragment>
        {props.liTasks.keys().map((x) => {
          return <p className="card-text">{x}</p>;
        })}
      </React.Fragment>
    );

    return <p className="card-text">{disp}</p>;
  }
};
export default ListTasks;
